import React, { useState, useEffect } from 'react';

function BusinessInsights() {
  const [restaurantData, setRestaurantData] = useState([]);
  const [searchPhone, setSearchPhone] = useState('');
  const [longtitude, setLongtitude] = useState('');
  const [latitude, setLatitude] = useState('');

  useEffect(() => {
    fetch('/api/restaurantData')
      .then(response => response.json())
      .then(data => setRestaurantData(data))
      .catch(error => console.error('Error fetching restaurant data', error));
  }, []);

  const filteredRestaurants = restaurantData.filter(restaurant =>
    restaurant.phoneNumber.includes(searchPhone)
  );

  const handleVerify = () => {
    // Assuming you have a backend route for verification
    fetch('/api/verifyDeliveryAvailability', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ longtitude, latitude }),
    })
    .then(response => response.json())
    .then(result => {
      // Update the availability status in the filtered restaurants
      const updatedRestaurants = filteredRestaurants.map(restaurant => {
        if (result[restaurant.id]) {
          return { ...restaurant, availability: true };
        } else {
          return { ...restaurant, availability: false };
        }
      });
      setRestaurantData(updatedRestaurants);
    })
    .catch(error => console.error('Error verifying delivery availability', error));
  };

  return (
    <div className="mt-7 text-center">
      <h2 className="text-2xl font-bold mb-4">Delivery Availability</h2>
      <h1>Verify Delivery Availability for User's Location</h1>
      <div className="flex justify-center items-center mt-4">
        <label htmlFor="longtitude" className="mr-2">Longtitude:</label>
        <input
          type="text"
          id="longtitude"
          value={longtitude}
          onChange={(e) => setLongtitude(e.target.value)}
          className="border px-2 py-1 rounded mr-2"
        />
        <label htmlFor="latitude" className="mr-2">Latitude:</label>
        <input
          type="text"
          id="latitude"
          value={latitude}
          onChange={(e) => setLatitude(e.target.value)}
          className="border px-2 py-1 rounded mr-2"
        />
        <button onClick={handleVerify} className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Verify</button>
      </div>
      <table className="border-collapse mx-auto rounded-lg overflow-hidden mt-4">
        <thead>
          <tr>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Restaurant Name</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Cuisine Type</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Phone Number</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Longtitude</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Latitude</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Delivery Distance</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Availability</th>
          </tr>
        </thead>
        <tbody>
          {filteredRestaurants.map(restaurant => (
            <tr key={restaurant.id}>
              <td className="border px-4 py-2 text-black">{restaurant.restaurantName}</td>
              <td className="border px-4 py-2 text-black">{restaurant.cuisineType}</td>
              <td className="border px-4 py-2 text-black">{restaurant.phoneNumber}</td>
              <td className="border px-4 py-2 text-black">{restaurant.longtitude}</td>
              <td className="border px-4 py-2 text-black">{restaurant.latitude}</td>
              <td className="border px-4 py-2 text-black">{restaurant.deliveryDistance}</td>
              <td className="border px-4 py-2 text-black">{restaurant.availability ? "True" : "False"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default BusinessInsights;
